import React,{useState} from 'react';

export default function Embed (props) {
    let link = `/Project?name=${props.name}`

    const [hover, setHover] = useState(false)

    return (
      <button className="section-entry"  onMouseEnter={()=> setHover(true)} onMouseLeave={()=> setHover(false)}>
      <iframe src= {props.src} frameborder="0"  width="190px" height="190px" allowfullscreen="true" mozallowfullscreen="true" webkitallowfullscreen="true"></iframe>
      <img className={`play-entry-button ${hover ? "Show" : ""}`} src = "./content/Images-Profile/playbutton.png"/>
      </button>
    );
  }
